import React from 'react'
import './AboutMe.css'

const AboutMe = () => {
    return (
        <div class="main">
            <div id="name-wrap">
                <img class="slide-in-blurred-top" src="https://i.imgur.com/4Br6mmd.png"/>
                <h2 class="slide-in-left">Front End / Full Stack Developer</h2>
            </div>
        </div>
    )
}

export default AboutMe;
